import React from "react";
import "../Trending Content/Trending.css";
import JsonData from "../../data.json";
import CardDetails from "../Card Details/CardDetails";

const Trending = () => {
  const trendingContent = {
    data: JsonData.filter((trending) => trending.isTrending === true),
    header: "Trending",
  };

  const trending = trendingContent.data.map((films) => {
    return (
      <div className="card">
        <img src={films.thumbnail.trending.small} alt="tredning film cover" />
      </div>
    );
  });

  return <div className="trending-container">{trending}</div>;
};

export default Trending;
